import React from 'react';
import {
  Home,
  LayoutDashboard,
  FileText,
  BarChart2,
  Calculator,
  Settings,
  HelpCircle,
  ArrowRight,
  ShieldCheck,
  BarChart,
  Globe,
  CloudUpload
} from 'lucide-react';

const styles = {
  landingPage: {
    display: 'flex',
    height: '100vh',
    backgroundColor: '#f4f4f9',
    fontFamily: 'Arial, sans-serif',
  },
  sidebar: {
    width: '250px',
    background: 'linear-gradient(to bottom right, #064e3b, #276749)',
    color: 'white',
    padding: '20px',
    boxSizing: 'border-box',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-start',
    position: 'fixed',
    height: '100vh',
    zIndex: 10,
    boxShadow: '2px 0 15px rgba(0, 0, 0, 0.15)',
    transition: 'width 0.3s ease',
  },
  logo: {
    fontSize: '30px',
    marginBottom: '30px',
    fontWeight: 'bold',
    color: '#fff',
    textAlign: 'center',
    marginTop: '20px',
    transition: 'transform 0.3s ease',
  },
  logoHover: {
    transform: 'scale(1.1)',
  },
  navList: {
    listStyle: 'none',
    padding: 0,
    margin: 0,
    width: '100%',
  },
  navItem: {
    color: 'white',
    textDecoration: 'none',
    padding: '15px 20px',
    display: 'flex',
    alignItems: 'center',
    width: '100%',
    borderRadius: '8px',
    marginBottom: '12px',
    transition: 'background-color 0.3s ease, transform 0.3s ease',
    cursor: 'pointer',
  },
  navItemHover: {
    backgroundColor: '#3b6b5c',
    transform: 'scale(1.05)',
  },
  navIcon: {
    marginRight: '20px',
    transition: 'transform 0.3s ease',
  },
  content: {
    flex: 1,
    padding: '30px',
    boxSizing: 'border-box',
    backgroundColor: '#fff',
    overflowY: 'auto',
    marginLeft: '250px',
    transition: 'margin-left 0.3s ease',
  },
  header: {
    marginBottom: '30px',
    borderBottom: '2px solid #f0f0f0',
    paddingBottom: '10px',
  },
  mainSection: {
    padding: '30px',
    backgroundColor: '#f9f9f9',
    borderRadius: '12px',
    boxShadow: '0 4px 15px rgba(0, 0, 0, 0.1)',
    marginBottom: '30px',
    transition: 'box-shadow 0.3s ease',
  },
  button: {
    backgroundColor: '#fff',
    color: '#276749',
    padding: '12px 25px',
    borderRadius: '8px',
    border: 'none',
    fontWeight: 'bold',
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
    transition: 'transform 0.3s ease, background-color 0.3s ease, box-shadow 0.3s ease',
    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
  },
  buttonHover: {
    transform: 'scale(1.05)',
    backgroundColor: '#276749',
    color: '#fff',
    boxShadow: '0 6px 15px rgba(0, 0, 0, 0.2)',
  },
  buttonOutline: {
    backgroundColor: 'transparent',
    color: '#fff',
    padding: '12px 25px',
    borderRadius: '8px',
    border: '1px solid #fff',
    fontWeight: 'bold',
    transition: 'background-color 0.3s ease, transform 0.3s ease, box-shadow 0.3s ease',
  },
  buttonOutlineHover: {
    backgroundColor: '#fff',
    color: '#276749',
    transform: 'scale(1.05)',
    boxShadow: '0 6px 15px rgba(0, 0, 0, 0.1)',
  },
};

// Features Data
const features = [
  {
    icon: FileText,
    title: 'Automated Reporting',
    description: 'Generate comprehensive ESG reports with just a few clicks. Save time and reduce errors.',
  },
  {
    icon: BarChart2,
    title: 'Data Analytics',
    description: 'Powerful analytics tools to track and visualize your sustainability metrics.',
  },
  {
    icon: Calculator,
    title: 'Carbon Calculator',
    description: 'Accurate carbon footprint calculations based on industry standards.',
  },
  {
    icon: Trophy,
    title: 'Benchmarking',
    description: 'Compare your ESG performance against industry peers and standards.',
  },
];

const FeatureCard = ({ title, description, icon: Icon }) => {
  return (
    <div
      style={{
        backgroundColor: 'white',
        padding: '20px',
        borderRadius: '12px',
        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
        transition: 'box-shadow 0.3s ease',
      }}
      onMouseEnter={(e) => (e.currentTarget.style.boxShadow = '0 6px 15px rgba(0, 0, 0, 0.2)')}
      onMouseLeave={(e) => (e.currentTarget.style.boxShadow = '0 4px 10px rgba(0, 0, 0, 0.1)')}
    >
      <div
        style={{
          backgroundColor: '#e6f4ea',
          width: '50px',
          height: '50px',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          borderRadius: '8px',
          marginBottom: '15px',
        }}
      >
        <Icon style={{ color: '#276749', fontSize: '24px' }} />
      </div>
      <h3 style={{ fontSize: '20px', fontWeight: 'bold', marginBottom: '10px', color: '#333' }}>{title}</h3>
      <p style={{ fontSize: '14px', color: '#666' }}>{description}</p>
    </div>
  );
};

// Stats Data
const stats = [
  { value: '2M+', label: 'Carbon Data Points' },
  { value: '500+', label: 'Companies' },
  { value: '98%', label: 'Accuracy Rate' },
  { value: '24/7', label: 'Support' },
];

const menuItems = [
  { icon: Home, label: 'Home', path: '/land' },
  { icon: CloudUpload, label: 'Data Upload', path: '/data-upload' },
  { icon: LayoutDashboard, label: 'Dashboard', path: '/dashboard' },
  { icon: FileText, label: 'Reports', path: '/reports' },
  { icon: BarChart2, label: 'Comparison', path: '/comparison' },
  { icon: Calculator, label: 'Carbon Calculator', path: '/calculator' },
  { icon: Settings, label: 'Settings', path: '/settings' },
  { icon: HelpCircle, label: 'Help & Support', path: '/help' },
];

const LandingPage = () => {
  return (
    <div style={styles.landingPage}>
      {/* Sidebar */}
      <nav style={styles.sidebar}>
        <h2
          style={styles.logo}
          onMouseEnter={(e) => e.target.style.transform = 'scale(1.1)'}
          onMouseLeave={(e) => e.target.style.transform = ''}
        >
          Platform Logo
        </h2>
        <ul style={styles.navList}>
          {menuItems.map((item) => (
            <li key={item.path}>
              <a
                href={item.path}
                style={styles.navItem}
                onMouseEnter={(e) => {
                  e.target.style.backgroundColor = '#3b6b5c'; // Hover effect color
                  e.target.style.transform = 'scale(1.05)';
                }}
                onMouseLeave={(e) => {
                  e.target.style.backgroundColor = '';
                  e.target.style.transform = '';
                }}
              >
                <item.icon style={styles.navIcon} size={20} />
                <span>{item.label}</span>
              </a>
            </li>
          ))}
        </ul>
      </nav>

      {/* Main Content */}
      <main style={styles.content}>
        {/* Hero Section */}
        <div
          style={{
            background: 'linear-gradient(to bottom right, #2f855a, #276749)',
            color: 'white',
            padding: '50px',
            borderRadius: '12px',
            marginBottom: '30px',
            textAlign: 'center',
            transition: 'transform 0.3s ease',
          }}
        >
          <h1 style={{ fontSize: '42px', fontWeight: 'bold', marginBottom: '20px' }}>
            Transform Your ESG Reporting Process
          </h1>
          <p style={{ fontSize: '20px', marginBottom: '30px' }}>
            Generate comprehensive ESG reports, track sustainability metrics, and make data-driven decisions with our powerful platform.
          </p>
          <div style={{ display: 'flex', gap: '15px', justifyContent: 'center' }}>
            <button
              style={{ ...styles.button, ...styles.buttonHover }}
            >
              Get Started <ArrowRight size={20} />
            </button>
            <button
              style={{ ...styles.buttonOutline, ...styles.buttonOutlineHover }}
            >
              Watch Demo
            </button>
          </div>
        </div>

        {/* Features Section */}
        {/* Features Section */}
        <section style={styles.mainSection}>
          <h2 style={{ fontSize: '30px', fontWeight: 'bold', marginBottom: '20px' }}>Platform Features</h2>
          <div style={{ display: 'flex', gap: '30px', flexWrap: 'wrap' }}>
            {features.map((feature, index) => (
              <FeatureCard
                key={index}
                title={feature.title}
                description={feature.description}
                icon={feature.icon}
              />
            ))}
          </div>
        </section>

        {/* Stats Section */}
        <section style={styles.mainSection}>
          <h2 style={{ fontSize: '30px', fontWeight: 'bold', marginBottom: '20px' }}>Our Impact</h2>
          <div style={{ display: 'flex', gap: '30px' }}>
            {stats.map((stat, index) => (
              <div key={index} style={{ textAlign: 'center' }}>
                <p style={{ fontSize: '40px', fontWeight: 'bold', color: '#276749' }}>
                  {stat.value}
                </p>
                <p>{stat.label}</p>
              </div>
            ))}
          </div>
        </section>
      </main>
    </div>
  );
};

export default LandingPage;
